import React from "react";
import Avatar from "./Avatar";

function ContactCard(props)
{
    return (

        <div className="card" >
            <div className="top">
                <h2 className="name" >{props.name}</h2>
                <Avatar img = {props.img}/>
            </div>
            <Info detils = {props.tel}/>
            
        </div>
    )
}
export default ContactCard;
